import React from "react";

const Experience = () => {
  return (
    <section id="experience" className="mt-12">
      <h2 className="text-2xl font-semibold mb-4 text-blue-700">Experience</h2>
      <p>
        <strong>Full Stack Developer – Proneta Tech Pvt. Ltd.</strong> (Jan 2023
        – Present)
      </p>
      <p className="mt-2 text-sm">
        Responsible for end-to-end development using React.js, Node.js, and
        MongoDB. Owned features, handled performance optimization, integrations
        (Razorpay, Google Analytics), authentication (JWT), and cloud
        deployment.
      </p>
    </section>
  );
};

export default Experience;
